import './AboutMe.css';

function AboutMe() {
  return (
    <section id="about-me" class="hero">
    <h1 class="hero-name">
        <p>
            Hi! &#128075; <br />
            My Name is Priscilla Montalvo
        </p>
    </h1>
    <div class="my-image">
        <img src="./assets/images/IMG_3558.jpg" alt="" />
    </div>
    </section>
  );
}

export default AboutMe;
